import Button from "../UI/Button";
import classes from "./header.module.css";

function Header() {
  return (
    <header>
      <nav className={classes.main_nav}>
        <Button styleClass="button-main">Logo</Button>

        <div className="nav-middle">
          <Button>Jobs</Button>
          <Button textOnly>Messages</Button>
          <Button textOnly>Payment</Button>
        </div>
      </nav>
    </header>
  );
}

export default Header;
